import LottieAnimation from "../../components/Lotties";
import Animation from "../../assets/page_not_found_svg";

const PageNotFound = () => {
  return (
    <div>
      <h1>
        OPS ! <span> A página que você está procurando não foi encontrada</span>
      </h1>
      <div className="lootie">
        <LottieAnimation lotti={Animation} height={500} width={500} />
      </div>
    </div>
  );
};

export default PageNotFound;
